import React from 'react'

const TodoForm = ({ addTask, setTask, setTaskAndReset }) => {
  return (
    <form>
      <input
        type="text"
        placeholder="New task"
        value="hoho"
        onChange={setTask}
      />
      <button onClick={() => setTaskAndReset()}>Přidat úkol</button>
    </form>
  )
}

export default TodoForm
